  input: TEXT,F3XA,,"The Fairfax County Democratic Committee is an all volunteer committee
    with no paid staff of any kind. There are no other entities whose employees work
    for the committee either part time or full time and receive compensation from
    another entity.  No payroll expenses are incurred. The committee maintains both
    Federal and Non federal accounts, and it has elected not to allocate its administrative
    expenses between accounts, so all administrative expenses of the Committee are
    paid with Federal funds.      In a letter dated March 28, 2007, from Daniel Buckley,
    Campaign Finance Analyst, Reports Analysis Division, questions were raised about
    expenses itemized in this report. The report has been amended to clarify that
    fund raising expenditures are not made on behalf of specifically identified Federal
    candidates, and do not meet the definition to be reported as Federal Election
    Activity. Other election activities are properly classified as Federal Election
    Activity. The report has been amended to show these expenses on Schedule B supporting
    line 30(b).  Memo text explanations were appended to expenditures for which questions
    were raised. In addition, when committee members were reimbursed more than $200
    for Committee expnenses, memo text entries were added to identify the vendors
    from whom purchased were made to benefit the Committee."
